import React from 'react';
import { Navbar, Container } from 'react-bootstrap';
import { ArrowLeft } from 'react-bootstrap-icons';
import MobileMenu from './MobileMenu';

const NavbarTop = () => {
  return (
    <div>
      {/* Fixed back arrow icon */}
      <div style={{ position: 'fixed', top: 20, right: 20, zIndex: 1000 }}>
        <ArrowLeft size={30} color="white" />
      </div>

      {/* Main mobile navbar */}
      <Navbar expand="md" className="py-4 px-3 text-white" bg="transparent">
        <Container fluid className="flex-column align-items-start p-0">
          {/* Brand text */}
          <Navbar.Brand className="fw-bold lh-1" style={{ fontSize: '2.5rem', color: 'white' }}>
            VAN<br />HOLTZ<br />CO.
          </Navbar.Brand>

          {/* Menu Links */}
          <div className="mt-4" style={{ fontSize: '0.9rem' }}>
            <p className="mb-1"><span style={{ fontSize: '0.7rem' }}>01</span> &nbsp; about</p>
            <p className="mb-1"><span style={{ fontSize: '0.7rem' }}>02</span> &nbsp; journal</p>
          </div>

          {/* External menu component */}
          <MobileMenu />
        </Container>
      </Navbar>
    </div>
  );
};

export default NavbarTop;
